const canvas = document.getElementById('canvas1');
const ptb = canvas.getContext('2d');

const img1 = new Image();
img1.src = 'data:image/png;base64,';


const inputSlider = document.getElementById('resolution');
const inputLabel = document.getElementById('resolutionLabel');
inputSlider.addEventListener('change', handleSlider);

class Cell {
  constructor(x, y, symbol, color) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }
  draw(ptb) {
    ptb.fillStyle = 'white';
    ptb.fillText(this.symbol, this.x + 0.5, this.y + 0.5);
    ptb.fillStyle = this.color;
    ptb.fillText(this.symbol, this.x, this.y);
  }
}
class AsciiEffect {
  #imageCellArray = [];
  #pixels = [];
  #ptb;
  #width;
  #height;
  constructor(ptb, width, height) {
    this.#ptb = ptb;
    this.#width = width;
    this.#height = height;
    this.#ptb.drawImage(img1, 0, 0, this.#width, this.#height);
    this.#pixels = this.#ptb.getImageData(0, 0, this.#width, this.#height);
  }
  #convertToSymbol(r) {
    if (r > 250) return '@';
    else if (r > 240) return '^';
    else if (r > 220) return '#';
    else if (r > 200) return '!';
    else if (r > 180) return '*';
    else if (r > 160) return '%';
    else if (r > 140) return '$';
    else if (r > 120) return '?';
    else if (r > 100) return '+';
    else if (r > 80) return '~';
    else if (r > 60) return '_';
    else if (r > 40) return '-';
    else if (r > 20) return '>';
    else return '';

  }
  #scanImage(cellSize) {
    this.imageCellArray = [];
    for (let y = 0; y < this.#pixels.height; y += cellSize) {
      for (let x = 0; x < this.#pixels.width; x += cellSize) {
        const popX = x * 4;
        const popY = y * 4;
        const pop = (popY * this.#pixels.width) + popX;

        if (this.#pixels.data[pop + 3] > 128) {
          const red = this.#pixels.data[pop];
          const green = this.#pixels.data[pop + 1];
          const blue = this.#pixels.data[pop + 2];
          const total = red + green + blue;
          const colorValue = total / 3;
          const color = "rgb(" + red + ", " + green + " " + blue + ")";
          const symbol = this.#convertToSymbol(colorValue);
          if (total > 200) this.#imageCellArray.push(new Cell(x, y, symbol, color));
        }
      }
    }
    console.log(this.#imageCellArray);
  }
  #drawAscii() {
    this.#ptb.clearRect(0, 0, this.#width, this.#height);
    for (let i = 0; i < this.#imageCellArray.length; i++) {
      this.#imageCellArray[i].draw(this.#ptb);
    }
  }
  draw(cellSize) {
    this.#scanImage(cellSize);
    this.#drawAscii();
  }
}

let effect;

function handleSlider() {
  if (inputSlider.value == 1) {
    inputLabel.innerHTMl = 'Original Image';
    ptb.drawImage(img1, 0, 0, canvas.width, canvas.height);
  } else {
    inputLabel.innerHTMl = "Resolution: " + inputSlider.value + "px";
    effect.draw(parseInt(inputSlider.value));
    ptb.font = parseInt(inputSlider.value) * 2 + 'px Verdana'
  }
}

img1.onload = function initialize() {
  canvas.width = img1.width;
  canvas.height = img1.height;
  // ptb.drawImage(img1, 0,0);
  effect = new AsciiEffect(ptb, img1.width, img1.height);
  handleSlider();
  effect.draw(100);
}
